import React, { useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Mousewheel } from "swiper/modules";
import "swiper/css";
import "swiper/css/navigation";
import "photoswipe/style.css";
import "../css/styles.css"; // make sure your CSS files are imported

const ProductDetailSection = () => {
  // Replace these with your real product image paths
  const images = Array.from({ length: 11 }, (_, i) => require(`../images/products/fashion/product-${i + 1}.jpg`));
  const [selectedImage, setSelectedImage] = useState(images[0]);

  return (
    <section className="flat-single-product flat-spacing-3">
      <div className="tf-main-product section-image-zoom">
        <div className="container">
          <div className="row">
            {/* Product Images */}
            <div className="col-md-6 d-flex">
              {/* Thumbnail Vertical Slider */}
              <div className="col-3">
                <Swiper
                  direction="vertical"
                  slidesPerView={4}
                  spaceBetween={10}
                  mousewheel={true}
                  navigation={true}
                  modules={[Navigation, Mousewheel]}
                  className="product-thumb-swiper"
                  style={{ height: "400px" }}
                >
                  {images.map((img, i) => (
                    <SwiperSlide key={i}>
                      <img
                        src={img}
                        alt={`product-${i}`}
                        onClick={() => setSelectedImage(img)}
                        className={`thumb-img ${selectedImage === img ? "active" : ""}`}
                        style={{
                          width: "100%",
                          height: "90px",
                          objectFit: "cover",
                          borderRadius: "6px",
                          border: selectedImage === img ? "2px solid gold" : "1px solid #ddd",
                          cursor: "pointer",
                        }}
                      />
                    </SwiperSlide>
                  ))}
                </Swiper>
              </div>

              {/* Main Product Image */}
              <div className="col-9 d-flex justify-content-center align-items-center">
                <div className="main-img-wrapper">
                  <img
                    src={selectedImage}
                    alt="Main Product"
                    className="main-img zoom-effect"
                    style={{
                      width: "100%",
                      height: "auto",
                      borderRadius: "10px",
                      boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
                      transition: "transform 0.3s ease",
                    }}
                  />
                </div>
              </div>
            </div>

            {/* Product Info */}
            <div className="col-md-6">
              <div className="tf-product-info-wrap">
                <h2 className="product-info-name">Casual Round Neck T-Shirt</h2>

                <div className="rating d-flex gap-2">
                  {Array.from({ length: 5 }, (_, i) => (
                    <svg
                      key={i}
                      width="14"
                      height="14"
                      viewBox="0 0 14 14"
                      fill="none"
                      xmlns="http://www.w3.org/2000/svg"
                    >
                      <path
                        d="M14 5.4091L8.913 5.07466L6.99721 0.261719L5.08143 5.07466L0 5.4091L3.89741 8.7184L2.61849 13.7384L6.99721 10.9707L11.376 13.7384L10.097 8.7184L14 5.4091Z"
                        fill="#EF9122"
                      />
                    </svg>
                  ))}
                  <div className="reviews text-main ms-2">(3,671 reviews)</div>
                </div>

                <div className="product-info-price mt-3">
                  <span className="price-new h3 fw-bold text-primary">$14.99</span>
                  <span className="price-old text-muted ms-3">
                    <del>$19.33</del>
                  </span>
                  <span className="badge bg-warning ms-2">-29%</span>
                </div>

                <p className="mt-3">
                  Soft, breathable cotton T-shirt with a comfortable fit and durable stitching.
                </p>

                <button className="btn btn-primary mt-3">Add to Cart</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ProductDetailSection;
